var title_f28_40_29318="MRI Exserohilum meningitis and stroke";
var content_f28_40_29318=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ID%2F86861&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ID%2F86861&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 531px\">",
"   <div class=\"ttl\">",
"    Brain and neck magnetic resonance imaging from a patient with Exserohilum meningitis and stroke",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 511px; height: 327px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Axial diffusion-weighted imaging from hospital days 4 (A) and 7 (B) shows progression of pontine infarction (arrows). Axial T2-weighted fluid attenuated inversion recovery imaging from hospital days 4 (C) and 7 (D) similarly shows disease progression as indicated by increasing hyperintensity in the midbrain (arrows) and interval development of ventriculomegaly secondary to brain stem edema (asterisks). Additional infarctions with comparable evolution were located in the medulla and cerebellar hemispheres (not shown). Coronal T1 imaging after the administration of intravenous gadolinium on hospital day 7 (E) shows diffuse leptomeningeal enhancement (arrows) and ventriculomegaly (asterisks). Axial T2-weighted short tau inversion recovery imaging (F) and T1-weighted imaging after the administration of intravenous gadolinium (G) of the neck show hyperintensity and abnormal enhancement in cervical paraspinal muscles at the epidural steroid injection site, suggesting subcutaneous edema and possible infected fluid collection (arrows).",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Lyons JL, Gireesh ED, Trivedi JB, et al. Fatal Exserohilum meningitis and central nervous system vasculitis after cervical methylprednisolone injection. Ann Intern Med 2012. Copyright &copy; 2012 American College of Physicians.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
