var title_f28_40_29325="RA disease activity indices";
var content_f28_40_29325=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=RHEUM%2F75446&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=RHEUM%2F75446&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Rheumatoid arthritis disease activity indices: Calculation, cutpoints, and ranges of composite indices",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        &nbsp;",
"       </td>",
"       <td class=\"subtitle1\">",
"        No of variables",
"       </td>",
"       <td class=\"subtitle1\">",
"        Acute phase reactant",
"       </td>",
"       <td class=\"subtitle1\">",
"        Formulae (CRP in mg/L for DAS and DAS28, and in mg/dL for SDAI; GH: VAS in mm; PGA and EGA: VAS in cm)",
"       </td>",
"       <td class=\"subtitle1\">",
"        Cutpoints",
"       </td>",
"       <td class=\"subtitle1\">",
"        Response criteria",
"       </td>",
"      </tr>",
"      <tr>",
"       <td rowspan=\"4\">",
"        DAS*",
"       </td>",
"       <td>",
"        4",
"       </td>",
"       <td>",
"        ESR",
"       </td>",
"       <td>",
"        = 0.54 x &radic;(Ritchie) + 0.065 x SJC44 + 0.33 x log",
"        <sub>",
"         nat",
"        </sub>",
"        (ESR) + 0.0072 x GH",
"       </td>",
"       <td rowspan=\"4\">",
"        <p>",
"         REM &lt;1.6",
"        </p>",
"        <p>",
"         LDA &lt;2.4",
"        </p>",
"        <p>",
"         MDA &lt;3.7",
"        </p>",
"        <p>",
"         HDA &ge;3.7",
"        </p>",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        4",
"       </td>",
"       <td>",
"        CRP",
"       </td>",
"       <td>",
"        = 0.54 x &radic;(Ritchie) + 0.065 x SJC44 + 0.17 x log",
"        <sub>",
"         nat",
"        </sub>",
"        (CRP+1) + 0.0072 x GH + 0.45",
"       </td>",
"       <td>",
"        n.v.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        3",
"       </td>",
"       <td>",
"        ESR",
"       </td>",
"       <td>",
"        = 0.54 x &radic;(Ritchie) + 0.065 x SJC44 + 0.33 x log",
"        <sub>",
"         nat",
"        </sub>",
"        (ESR) + 0.22",
"       </td>",
"       <td>",
"        n.v.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        3",
"       </td>",
"       <td>",
"        CRP",
"       </td>",
"       <td>",
"        = 0.54 x &radic;(Ritchie) + 0.065 x SJC44 + 0.17 x log",
"        <sub>",
"         nat",
"        </sub>",
"        (CRP+1) + 0.65",
"       </td>",
"       <td>",
"        n.v.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td rowspan=\"4\">",
"        DAS28*",
"       </td>",
"       <td>",
"        4",
"       </td>",
"       <td>",
"        ESR",
"       </td>",
"       <td>",
"        = 0.56 x &radic;(TJC28) + 0.28 x &radic;(SJC28) + 0.70 x log",
"        <sub>",
"         nat",
"        </sub>",
"        (ESR) + 0.014 x GH",
"       </td>",
"       <td rowspan=\"4\">",
"        <p>",
"         REM &lt;2.6",
"        </p>",
"        <p>",
"         LDA 2.6-3.2",
"        </p>",
"        <p>",
"         MDA &gt;3.2-5.1",
"        </p>",
"        <p>",
"         HDA &gt;5.1",
"        </p>",
"       </td>",
"       <td>",
"        <p>",
"         Moderate &gt;0.6",
"        </p>",
"        <p>",
"         Major &gt;1.2",
"         <sup>",
"          &bull;",
"         </sup>",
"        </p>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        4",
"       </td>",
"       <td>",
"        CRP",
"       </td>",
"       <td>",
"        = 0.56 x &radic;(TJC28) + 0.28 x &radic;(SJC28) + 0.36 x log",
"        <sub>",
"         nat",
"        </sub>",
"        (CRP+1) + 0.014 x GH + 0.96",
"       </td>",
"       <td>",
"        n.v.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        3",
"       </td>",
"       <td>",
"        ESR",
"       </td>",
"       <td>",
"        = [0.56 x &radic;(TJC28) + 0.28 x &radic;(SJC28) + 0.70* x log",
"        <sub>",
"         nat",
"        </sub>",
"        (ESR)] x 1.08 + 0.16",
"       </td>",
"       <td>",
"        n.v.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        3",
"       </td>",
"       <td>",
"        CRP",
"       </td>",
"       <td>",
"        = [0.56 x &radic;(TJC28) + 0.28*&radic;(SJC28) + 0.36* log",
"        <sub>",
"         nat",
"        </sub>",
"        (CRP+1)] x 1.10 + 1.15",
"       </td>",
"       <td>",
"        n.v.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        SDAI",
"       </td>",
"       <td>",
"        5",
"       </td>",
"       <td>",
"        CRP",
"       </td>",
"       <td>",
"        SJC28 + TJC28 + PGA + EGA + CRP",
"       </td>",
"       <td>",
"        REM &le;3.3; LDA &le;11; MDA &le;26; HDA &gt;26",
"       </td>",
"       <td>",
"        <p>",
"         Minor &ge;50 percent",
"        </p>",
"        <p>",
"         Moderate &ge;70 percent",
"        </p>",
"        <p>",
"         Major &ge;85 percent",
"        </p>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        CDAI",
"       </td>",
"       <td>",
"        4",
"       </td>",
"       <td>",
"        -",
"       </td>",
"       <td>",
"        SJC28 + TJC28 + PGA + EGA",
"       </td>",
"       <td>",
"        REM &le;2.8; LDA &le;10; MDA &le;22; HDA &gt;22",
"       </td>",
"       <td>",
"        <p>",
"         Minor &ge;50 percent",
"        </p>",
"        <p>",
"         Moderate &ge;70 percent",
"        </p>",
"        <p>",
"         Major &ge;85 percent",
"        </p>",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     DAS: Disease Activity Score; DAS28: DAS based on 28 joint counts; Ritchie: Ritchie articular index; SJC28, SJC44: swollen joint counts based on the evaluation of 28 or 44 joints, respectively; TJC28: tender joint count based on 28 joints; ESR: erythrocyte sedimentation rate; CRP: C-reactive protein; GH: global health; PGA, EGA: patient and evaluator global assessment of disease activity; REM: remission; LDA: low disease activity; MDA: moderate disease activity; HDA: high disease activity; n.v.: not validated.",
"     <br>",
"      * Formulae for the DAS and the DAS28 variations obtained from the Internet: www.das-score.nl/index.html (Accessed Sept 13, 2006).",
"      <br>",
"       <font class=\"bullet\">",
"        &bull;",
"       </font>",
"       Plus change in category as detailed in the text.",
"      </br>",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"     Data from:",
"     <br>",
"      <ol>",
"       <li>",
"        Aletaha D, Ward MM, Machold KP, Nell VPK, et al. Remission and active Disease in Rheumatoid arthritis: Defining criteria for disease activity states. Arthritis Rheum 2005; 52:2625.",
"       </li>",
"       <li>",
"        Aletaha D, Smolen J. The Simplified Disease Activity Index (SDAI) and the Clinical Disease Activity Index (CDAI): A review of their usefulness and validity in rheumatoid arthritis. Clin Exp Rheumatol 2005; 23:S100.",
"       </li>",
"       <li>",
"        Aletaha D, Martinez-Avila J, Kvien TK, Smolen JS. Definition of treatment response in rheumatoid arthritis based on the simplified and the clinical disease activity index. Ann Rheum Dis 2012.",
"       </li>",
"      </ol>",
"     </br>",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
